    SELECT b."WLID", avg(b.latency) AS "meanX", avg(b."LogEZD") AS "meanY", count(b."LogEZD") AS "N", sum((b.latency * b."LogEZD")) AS "sumXY", sum((b.latency * b.latency)) AS "sumXX" FROM "FUEndothel" b GROUP BY b."WLID";


