COPY sql_auditing (id, comment, sql_query, exclude, email) FROM stdin;
1	patient wartet ohne telefonnummer	select "PIZ", "Name", "Vorname", "Geburtsdatum" from "WartelisteUebersicht" where "WartenAktiviert"=True and "Telefon1" is null and "IDZentrum"=1	\N	\N
2	patient nicht auf WL ohne GrundExit	select "PIZ", "Name", "Vorname", "Geburtsdatum" from "WartelisteUebersicht" where  ("WartenAktiviert"=false or  "WartenAktiviert" is null) and ("GrundExitWL" is null or "EndeWarteliste" is null ) and "VerstorbenAm" is null	\N	\N
16	Freiburger patient vermeindlich operiert	select "PIZ", "Name", "Vorname", "Geburtsdatum","WartelisteUebersicht". "EndeWarteliste" as "VermeintlichesOPDatum" from "WartelisteUebersicht" join "Warteliste" on "Warteliste"."ID"="WLID" where  ("WartelisteUebersicht"."WartenAktiviert"=false or  "WartelisteUebersicht"."WartenAktiviert" is null) and ("WartelisteUebersicht"."GrundExitWL" =1 ) and "WartelisteUebersicht"."IDOrgankultur" is null and "WartelisteUebersicht"."IDZentrum" =1 and "WartelisteUebersicht"."EndeWarteliste">'2004-12-31' and ("ExternGemeldet" is null or "ExternGemeldet" is false) order by "WartelisteUebersicht"."EndeWarteliste"	\N	\N
13	patientendupletten	select * from (select count(*),"Name","Vorname", "Geburtsdatum" from "StammdatenPatient" group by "Name","Vorname", "Geburtsdatum") a where a.count>1 	f	\N
14	opdatum fehlt	select  "Name", "Vorname", "Geburtsdatum" from "WartelisteUebersicht" where "EndeWarteliste" is null and "IDOrgankultur" is not null	\N	\N
5	piz fehlt bei freiburger patient	select   "Name", "Vorname", "Geburtsdatum" from "WartelisteUebersicht" where "PIZ" is null and "IDZentrum"=1	\N	\N
7	verworfene HH wurde transplantiert	select "IDSpender"||"GesamtstatistikOrgankultur"."Auge" as "transplantat" from "GesamtstatistikOrgankultur" where "IDWarteliste" is not null and ( "IDVerwerfungsgrund" is not null and not "IDVerwerfungsgrund"=0)  	\N	\N
8	patient wartet trotz allokation	select "PIZ", "Name", "Vorname", "Geburtsdatum" from "WartelisteUebersicht" where "WartenAktiviert"=true and "IDOrgankultur" is not null	\N	\N
10	patient wartet auf match ohne HLA werte	select  "PIZ", "Name", "Vorname", "Geburtsdatum"  from "WartelisteUebersicht" left join (select "IDPatient", count(*) from "HLAPatient" group by "IDPatient") a on a."IDPatient"="WartelisteUebersicht"."PatientID" where ( count<3 or count is null) and "MaxHLAMismatches"<>6  and age("StartWarteliste")>'14 days' and "WartenAktiviert"=True\n	\N	\N
12	fehleingaben HLA spender	select  "IDSpender" from (select "IDSpender", count(*) from "HLASpender" group by "IDSpender") a where ( count<3 or count >6) 	\N	\N
11	fehleingaben HLA patient	select  "PIZ", "Name", "Vorname", "Geburtsdatum"  from "WartelisteUebersicht"  join (select "IDPatient", count(*) from "HLAPatient" group by "IDPatient") a on a."IDPatient"="WartelisteUebersicht"."PatientID" where ( count<3 or count >6) 	\N	\N
4	opdatum falsch	select "IDSpender"||"GesamtstatistikOrgankultur"."Auge" as "transplantat", "EndeWarteliste", "DatumKulturAusgang" from "WartelisteUebersicht" join "GesamtstatistikOrgankultur" on "GesamtstatistikOrgankultur"."IDOrgankultur"="WartelisteUebersicht"."IDOrgankultur" where age("DatumKulturAusgang","EndeWarteliste") not between '-6 days' and '6 days' order by "EndeWarteliste"	\N	\N
17	verwerfungsgrund fehlt	select  "IDSpender" from "Organkultur" where "IDVerwerfungsgrund" is  null and "IDWarteliste" is null and "EndOfCulture"=true and "IDSpender" is not null order by "IDSpender"	\N	\N
18	entnommen und nicht kultiviert	select * from "StammdatenHornhautspender" left join "Organkultur" on "Organkultur"."IDSpender"="StammdatenHornhautspender"."ID" where\n"Organkultur"."ID" is null and ("IDEntnahmemethodeR"<>3 or "IDEntnahmemethodeL"<>3)   and date_part('year'::text, "StammdatenHornhautspender"."Entnahmezeitpunkt")>2009\n	\N	\N
6	kulturdauer stimmt nicht	select "IDSpender"||"GesamtstatistikOrgankultur"."Auge" as "transplantat","KulturdauerGesamt"  from "GesamtstatistikOrgankultur" where "KulturdauerGesamt"> '50 days' and "IDVerwerfungsgrund" is not null and "IDSpender">300	\N	\N
19	Neue Studien-Keratoplastiken	select a.info as fancy_nummer, "Name", "Vorname", "Geburtsdatum", "Warteliste"."Bemerkungen", "EndeWarteliste" as opdatum,  "IDSpender"||"Organkultur"."Auge" as tp from "Warteliste"  join "StammdatenPatient" on "PatientID"="StammdatenPatient"."ID" join "Organkultur" on "IDOrgankultur"="Organkultur"."ID" join (SELECT a."ID", CASE WHEN a.info::text = 'A'::text THEN NULL::character varying ELSE a.info END AS info FROM ( SELECT "Warteliste"."ID", COALESCE("AufnahmeDiagnose"."Parameter", "Warteliste".fancy_nummer::text::character varying) AS info   FROM "Warteliste"\n LEFT JOIN "AufnahmeDiagnose" ON "AufnahmeDiagnose"."StationaerID" = "Warteliste"."ID" AND "AufnahmeDiagnose"."DiagnoseID" = 921   WHERE "Warteliste".fancy_nummer IS NOT NULL) a) a on a."ID"="Warteliste"."ID" \n   where  "IDOrgankultur" is not null and info is not null and "EndeWarteliste" >now()-'1 days'::interval	f	claudia.mueller.augenklinik@uniklinik-freiburg.de daniela.goos@uniklinik-freiburg.de
3	verwendungszweck stimmt nicht	select "IDSpender"||"Organkultur"."Auge" as "transplantat" from "WartelisteUebersicht" join "Organkultur" on "Organkultur"."ID"="IDOrgankultur" where precuttype in (1,2,9) and "IDOPArt" not in (12,14,16,17)	\N	\N
15	verwendungszweck stimmt nicht 2	select "IDSpender"||"Organkultur"."Auge" as "transplantat" from "WartelisteUebersicht" join "Organkultur" on "Organkultur"."ID"="IDOrgankultur" where precuttype=0 and "IDOPArt" in (12,14,16,17)	\N	\N
9	Abgleich OP-Auge mit WL-Auge	select  "PIZ","Name","Vorname","Geburtsdatum","EndeWarteliste" as op_datum,"Auge" as auge_hhb, auge as auge_opplaner from "WartelisteUebersicht" \nJOIN dblink('dbname=prometheus_copy'::text, 'select piz, date_trunc(''day'',op_date) as op_date, auge from data') t1(piz integer, op_date date, auge text) ON t1.piz = "PIZ"::integer AND t1.op_date="EndeWarteliste" \nwhere   "PIZ" is not null and "PIZ"<>'' and "IDOrgankultur" is not null and "EndeWarteliste" is not null and auge in ('RA','LA') and auge <>"Auge" and op_date>now()-'1 days'::interval\norder by "EndeWarteliste"	\N	\N
